import React, { useEffect, useState } from 'react';
import CustomListComp from './customListComp';

function UserListComp() {
    const users = [
        {
          firstName: "John",
          lastName: "Smith",
          username: "john.smith@sample.com",
        },
        {
          firstName: "Sarah",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "3",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "4",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "5",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "5",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "6",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "7",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "8",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        },
        {
          firstName: "9",
          lastName: "Doe",
          username: "sarah.doe@sample2.com",
        }
    ];

    return (
        <>
                            <div className = 'text-center'>
                    <h1 className = "display-4" style = {{ color : "white" }}>Financial Database</h1>
                    <p className = 'lead' style = {{ color : "white" }}>Easily and quickly</p>
                </div>
            <div className = 'container mx-auto' style = {{ width : "80%" }}>
                <CustomListComp data = { users } />
            </div>
        </>
    );
}

export default UserListComp;
